import React from 'react';

const Home = () => {
    return (
        <div className="home">
            <h1>Welcome to 130 1/2 INTERSTATE</h1>
            <p>Your one-stop solution for all your needs.</p>
            <img src="/path/to/your/image.jpg" alt="Introductory visual" />
            <h2>Explore Our Services</h2>
            <p>Check out what we offer and how we can help you.</p>
            <a href="/services">View Services</a>
            <h2>About Us</h2>
            <p>Learn more about our mission and values.</p>
            <a href="/about">Read More</a>
        </div>
    );
};

export default Home;
